    class Solution {
        public int lengthOfLongestSubstring(String s) {

            if (s == null || s.length() == 0) {
                return 0;
            }


            for (int i = s.length(); i > 0; i--) {
                boolean flag = withoutRepeatingCharactersInNeedLength(s, i);
                if (flag) {
                    return i;
                }
            }


            return 1;
        }


        /**
         * Âú®ËßÑÂÆöÁöÑÂ≠óÁ¨¶ÈïøÂ∫¶‰∏ãÔºåÊòØÂê¶ÊúâÂÖ®ÈÉ®‰∏çÈáçÂ§çÁöÑÂ≠óÁ¨¶
         */
        public boolean withoutRepeatingCharactersInNeedLength(String s, int needLength) {
            int cursorCount = s.length() - needLength;
            for (int i = 0; i <= cursorCount; i++) {

                String cursorStr = s.substring(i, needLength + i);
                boolean hasRepeat = hasRepeat(cursorStr);
                if (!hasRepeat) {
                    return true;
                }
            }
            return false;
        }


        /**
         * ÊòØÂê¶ÊúâÈáçÂ§çÂ≠óÁ¨¶
         */
        public boolean hasRepeat(String s) {
            Map<Character, Integer> map = new HashMap<>();
            for (int i = 0; i < s.length(); i++) {
                Character character = s.charAt(i);
                if (map.containsKey(character)) {
                    return true;
                }
                map.put(character, 1);
            }
            return false;
        }


    }
