    public static void testSubString(String s, int needLength) {
        int cursorCount = s.length() - needLength;
        for (int i = 0; i <= cursorCount; i++) {

            String cursorStr = s.substring(i, needLength + i);

            System.out.println("string:" + cursorStr + "     i:" + i + "     needLength+i:" + (needLength + i));
        }

    }


    class Solution2 {
        public int lengthOfLongestSubstring(String s) {
            // ÂìàÂ∏åÈõÜÂêàÔºåËÆ∞ÂΩïÊØè‰∏™Â≠óÁ¨¶ÊòØÂê¶Âá∫Áé∞Ëøá
            Set<Character> occ = new HashSet<Character>();
            int n = s.length();
            // Âè≥ÊåáÈíàÔºåÂàùÂßãÂÄº‰∏∫ -1ÔºåÁõ∏ÂΩì‰∫éÊàë‰ª¨Âú®Â≠óÁ¨¶‰∏≤ÁöÑÂ∑¶ËæπÁïåÁöÑÂ∑¶‰æßÔºåËøòÊ≤°ÊúâÂºÄÂßãÁßªÂä®
            int rk = -1, ans = 0;
            for (int i = 0; i < n; ++i) {
                if (i != 0) {
                    // Â∑¶ÊåáÈíàÂêëÂè≥ÁßªÂä®‰∏ÄÊ†ºÔºåÁßªÈô§‰∏Ä‰∏™Â≠óÁ¨¶
                    occ.remove(s.charAt(i - 1));
                }
                while (rk + 1 < n && !occ.contains(s.charAt(rk + 1))) {
                    // ‰∏çÊñ≠Âú∞ÁßªÂä®Âè≥ÊåáÈíà
                    occ.add(s.charAt(rk + 1));
                    ++rk;
                }
                // Á¨¨ i Âà∞ rk ‰∏™Â≠óÁ¨¶ÊòØ‰∏Ä‰∏™ÊûÅÈïøÁöÑÊó†ÈáçÂ§çÂ≠óÁ¨¶Â≠ê‰∏≤
                ans = Math.max(ans, rk - i + 1);
            }
            return ans;
        }
    }


